import React from 'react';

function Header() {
  return (
    <div className="h-fit text-day900 items-center flex w-full justify-between p-4 bg-day100">
        <div className='flex gap-2 items-center'>
            <img src='/src/assets/images/SparkLogo.png' className='w-8 h-8' />
            <div className='text-md'>Mayke</div>
        </div>
      <div className='text-md'>Archivio</div>
      <div className='text-md'>About</div>
      <div className='text-md'>Work</div>
    </div>
  );
}

export default Header;
